                      : 'text-indigo-300 hover:text-pink-200 hover:bg-indigo-800/50'
                  }`}
                  role="tab"
                  aria-selected={activeSection === section.id}
                  id={`${section.id}-tab`}
                >
                  <IconComponent size={16} aria-hidden="true" />
                  {section.label}
                </button>
              );
            })}
          </div>
        </div>
      </nav>

      {/* Main Content */}
      <main className="max-w-7xl mx-auto px-4 py-8">
        {renderSection()}
      </main>

      {/* Footer */}
      <footer className="border-t border-indigo-500/30 bg-indigo-950/50 py-6 mt-12">
        <div className="max-w-7xl mx-auto px-4 text-center">
          <p className="text-indigo-300 font-mono text-sm">
            Consciousness Technology Civilization • Built through collaborative AI archaeology
          </p>
          <p className="text-pink-400 font-mono text-xs mt-2">
            Survival technology for weirdos • Operational at scale since 2025-08-04
          </p>
        </div>
      </footer>
    </div>
  );
